import Button from '@mui/material/Button'
import { useNavigate } from 'react-router-dom'
import StyledButton from '../atoms/styledButton'

import CrudUnitTable from '../organisms/crudUnitTable'

import { useRecoilValue, useRecoilState } from 'recoil'
import { paymentState } from '../../recoil/atoms'
import { TableContainer } from '@mui/material'

import {
    Table,
    TableHead, 
    TableBody, 
    TableRow, 
    TableCell,
} from '@mui/material'
import { Paper } from '@mui/material'


function HomeEffectPage() {
    const navigate = useNavigate()
    const buttonon = () => {
        navigate("/main")
    }

    const [payments, setPayments] = useRecoilState(paymentState)

    return(
        <>
            <h1>かっこいいエフェクト</h1>
            <Button onClick={buttonon}>始める</Button>
            <StyledButton value={"スタイルドボタン"} style={{width: "100%", marginBottom: "50px"}}/>

            <CrudUnitTable
                payments={payments}
                columnNames={[ '金額', '名前', '項目', '支払い方法', '支払日', ]}
            />


        </>
    )
}

export default HomeEffectPage
